  async getData() {
    var nbaData = new URL( 'https://raw.githubusercontent.com/m-hemmings/MiscFiles/master/lively.next/RostersByTeamAndPosition.json')

    function getJSON(url) {
      'use strict';
        var xhr = new XMLHttpRequest();
        return new Promise((resolve, reject) => {
          xhr.onreadystatechange = function () {
            if (xhr.readyState === 4) {
              if (xhr.status === 200) {
                resolve(JSON.parse(xhr.responseText));
              } else {
                reject(xhr.responseText);
              }
            }
          };
          xhr.open('GET', url);
          xhr.send();
        });
      }  
      var players = await getJSON(nbaData)
      var nodes = []
      var edges = []
      console.log(players)
      players.forEach(player =>{
        var team = ({name: player.Team, label: player.Team, id: player.Team,tt: player.Team})
        var item = {
        id: player.Name + '_' + player.Team,
        tt: player.Name + '<BR>' + player.City + ' ' + player.Team,
        label: player.Name,
        ...player
        }

        nodes.push(item)
        if (nodes.filter(function(e) { return e.name == player.Team; }).length == 0) {
           nodes.push(team)
        }        
        edges.push({from: item.id, to: player.Team})
      })
      return {nodes,edges}

    }
}

