import { Button } from "lively.morphic/components/buttons.js";

export default class EditEdgeButton extends Button {
  trigger() {
    super.trigger()
    var selection = this.owner.network.getSelection()
    if (selection.edges.length == 1 && selection.nodes.length == 0){
      this.owner.network.editEdgeMode();
      this.owner.get('cancelButton').visible = true
    }
  }
}
